import styled from "styled-components"

export const HeaderContainer = styled.header`
    height: 15vh;
    width: 100%;
    background: black;
`

export const Container = styled.div`
    width: 80%;
    height: 100vh;
    margin: 0 auto;
    overflow-y: scroll;

    border-right: solid #FFFFFF80;
    border-left: solid black;
`
